      out.write("                    <p class=\"link\"><span>[M7] 문의 내용 입력하기</span></p>\r\n");
      out.write("                    <div class=\"ans\"><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">예약취소는&nbsp; 앱/웹 &gt; 내정보 &gt; 예약/구매내역에서 직접 가능합니다.</span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\"><br></span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">예약/결제 진행 당시 안내된 취소/환불 규정에 따라 처리되며, 취소수수료가 발생할 경우 취소수수료를 차감한 금액으로 환불 처리됩니다.</span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">일부 숙소에 한해 취소가 가능한 시점이나 앱/웹에서 취소가 불가할 수 있으니 이 경우에는 고객행복센터로 요청해 주시길 바랍니다.</span></font></div></div>\r\n");
      out.write("                </li>\r\n");
      out.write("                                <li>\r\n");
      out.write("                    <p class=\"link\"><span>[M7] 문의 내용 입력하기</span></p>\r\n");
      out.write("                    <div class=\"ans\"><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">천재지변(기상악화), 법정 감염병 등 불가항력적인 사유로 제휴점 이용이 불가할 경우 고객행복센터로 예약내역 및 증빙서류(결항확인서, e-티켓, 진단확인서 등)를 보내주시면 확인 후 예약취소 가능 여부를 확인해 드립니다.</span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\"><br></span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">다만, 당사는 판매 중개 플랫폼의 입장으로 제휴점에 대하여 취소/환불을 강제할 수 없어 각 제휴점의 규정에 근거하여 상황에 따라 수수료가 발생하거나 취소가 어려울 수 있는 점 양해 부탁드립니다.</span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\"><br></span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\"><b>[접수방법]</b></span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">※ 이메일 : help@goodchoice.kr (예약자명, 숙소명, 체크인 날짜 필수)</span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">※ 카카오톡 : 카카오톡 내 플러스 친구 &gt; 여기어때 고객행복센터 추가</span></font></div></div>\r\n");
