      out.write("                    <div class=\"ans\"><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">현금영수증은 현금성 결제수단으로 결제 시 발급이 가능합니다.</span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\"><br></span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">결제 단계에서 현금영수증을 신청하면 자동으로 발행되지만,</span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">신청을 누락했거나 발행받지 못한 경우라면 영수증 확인 후 국세청에서 자진발급분을 등록해 주시길 바랍니다.</span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\"><br></span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">[네이버페이]</span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">- 결제 단계에서 현금영수증 신청하면 자동으로 발행 (19년 12월 26일 시행)</span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">- 자진발급 : 네이버페이 &gt; 결제내역 &gt; 주문건 &gt; 주문상세정보 &gt; 영수증 발급내역 &gt; 현금영수증 확인</span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">- 단, 19년 12월 26일 10시 이전 결제 건은 여기어때 고객행복센터로 요청</span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\"><br></span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">[간편계좌이체 / TOSS / PAYCO]</span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">- 결제 단계에서 현금영수증 신청하면 자동으로 발행</span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">- 단, 간편계좌이체의 경우 신청 누락 시 여기어때 고객행복센터로 요청</span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\"><br></span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">[카카오페이]&nbsp;</span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">- 카카오페이머니 결제 시 자동으로 발행</span></font></div><div><font color=\"#252525\" face=\"arial\"><span style=\"font-size: 13.3333px;\">- 자진발급 : 카카오톡 &gt; pay &gt; 우측톱니바퀴(나의 카카오페이) &gt; 이용내역 &gt; 결제 &gt; 개별 상세내역 &gt; 현금영수증 확인</span></font></div></div>\r\n");
