      out.write("                    <div class=\"ans\"><p><font face=\"Arial\"><span style=\"font-size: 13px; white-space: pre-wrap;\">예약정보와 결제정보가 기재되어 있는 영수증(거래내역서)은 여기어때 고객행복센터로 문의하시면 발급이 가능합니다.\r\n");
      out.write("\r\n");
      out.write("예약내역, 영수증을 받으실 이메일 주소(또는 FAX번호)를 1:1문의 또는 카카오 상담톡으로 남겨주시길 바라며, 발급 완료까지는 영업일 기준 최대 1~2일 소요되오니 시간 양해 부탁드립니다.</span></font></p></div>\r\n");
